    `},{slug:"washington-cascades-mountains",title:"Washington Cascades: Mountains & Landscape",year:"2025",type:"Static Cartography",role:"Cartographer",description:"A static map emphasizing terrain structure and regional context through visual hierarchy and typographic choices.",cover:jm,featured:!1,images:[jm],links:[{label:"View PDF (Hi-res)",url:"/portfolio/file/Washington_cascade_mountains.pdf"}],tools:["ArcGIS Pro / QGIS","Cartographic design"],writeup:`
